import PostCard from "./PostCard";

const samplePost = {
  nickname: '홍길동',
  title: '첫 게시글입니다!',
  createdAt: '2025-06-13T10:00:00Z',
  updatedAt: '2025-06-13T12:00:00Z',
  contentHtml: `<p>이건 정말 긴 게시글의 예시입니다. <strong>HTML 형식</strong>도 포함돼요.<br>줄바꿈도 됩니다.</p>
                <p>이미지도 가능하고, 다양한 포맷이 적용될 수 있습니다. 여기에 아주 많은 텍스트가 있다고 가정합시다...</p>`,
  thumbnailImage: 'https://via.placeholder.com/600x300',
  comments: [
  {
    id: 'c1',
    author: '철수',
    content: '게시글 잘 읽었습니다!',
    createdAt: '2025-06-13T11:00:00Z',
    replies: [
      {
        id: 'r1',
        author: '영희',
        content: '저도 동감입니다!',
        createdAt: '2025-06-13T11:15:00Z',
      },
      {
        id: 'r2',
        author: '민수',
        content: '좋은 정보 감사합니다.',
        createdAt: '2025-06-13T11:20:00Z',
      },
    ],
  },
  {
    id: 'c2',
    author: '지영',
    content: '더 많은 사진을 보고 싶어요.',
    createdAt: '2025-06-13T11:30:00Z',
    replies: [],
  },
],
};

export default function ArticleTest() {
  return (
    <div className="max-w-xl mx-auto mt-10">
      <PostCard post={samplePost} />
    </div>
  );
}
